def apply(self, other):
    if not isinstance(other, datetime):
        raise ApplyTypeError("Only know how to combine business hour with datetime")

    adjusted_time = other.replace(minute=0, second=0, microsecond=0)
    next_opening_time = adjusted_time.replace(hour=self.start.hour)

    if self._is_on_offset(adjusted_time.time()) or adjusted_time.time() == self.start:
        # Time is already a business hour or at the starting hour
        return adjusted_time
    elif adjusted_time.time() > self.end:
        # Round down to the previous business hour
        adjusted_time = adjusted_time.replace(hour=self.end.hour, minute=0, second=0, microsecond=0)
    else:
        # Round up to the next business hour
        adjusted_time = adjusted_time.replace(hour=self.start.hour, minute=0, second=0, microsecond=0) + timedelta(hours=1)

    return adjusted_time
